import fakeResImg from "../../assets/fakeres.jpg"
import "./placeDetails.css"


const PlaceDetails = ({ place }) => {
  return (
    <div className="row" style={{width: '100%'}}>
      <div className="col s12">
        <div className="card">
          <div className="card-image">
            <img class="place-detail-card-img" 
            src={`${place.photo ? place.photo.images.large.url : fakeResImg}`}
            title={place.name} />
            <span className="card-title place-card-title">{place.name}</span>
          </div>
          <div className="card-content">
            <div className="flex justify-between">
              <div>Ranking</div>
              <div>{place.ranking}</div>
            </div>
            {
              place?.cuisine?.map((cuis, i)=>(
                <ul className="flex" key={i}>
                  <li className="food-chip">{cuis.name}</li>
                </ul>
              ))
            }
          </div>
          <div className="card-action">
            <a href="#">This is a link</a>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PlaceDetails;
